import React, { Component } from 'react';
class TinTuc extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: ""
    };
  }

  componentDidMount() {
    var url = 'server-spring-boot-api.herokuapp.com/api/CheckKey', options = null
    const apiUrl = 'server-spring-boot-api.herokuapp.com/api/CheckKey';
    fetch(apiUrl)
      .then((response) => {
        var temp = new String(response)
      })
      .then((data) => console.log('This is your data', data));

  }

  render() {

    return (
      <div>{this.state.items}</div>
    )
  }
}
export default TinTuc;
